import React from 'react';
import {
    View,Text,StyleSheet
} from 'react-native';

export default props => {
    return (
        <View style={{
            backgroundColor: props.cor,
            width: 50,
            height: 50,
            borderColor: 'black',
            
        }}>
        </View>
    )
}
